import React, { useEffect, useRef } from 'react';
import Svg, { Line, Defs, Pattern, Rect } from 'react-native-svg';
import { View, StyleSheet, Animated, Easing } from 'react-native';

const GridBackground = () => {
  const fadeAnim = useRef(new Animated.Value(0.4)).current;
  const translateAnim = useRef(new Animated.Value(0)).current;
  const fadeAnim2 = useRef(new Animated.Value(0.3)).current;
  const rotateAnim = useRef(new Animated.Value(0)).current;

  useEffect(() => {
    // Primary breathing animation - much faster
    const breathingAnimation = Animated.sequence([
      Animated.timing(fadeAnim, {
        toValue: 0.7,
        duration: 1500,  // Reduced from 3000
        easing: Easing.inOut(Easing.sine),
        useNativeDriver: true,
      }),
      Animated.timing(fadeAnim, {
        toValue: 0.4,
        duration: 1500,
        useNativeDriver: true,
      })
    ]);

    // Secondary breathing - much faster
    const breathingAnimation2 = Animated.sequence([
      Animated.timing(fadeAnim2, {
        toValue: 0.6,
        duration: 2000,  // Reduced from 4000
        useNativeDriver: true,
      }),
      Animated.timing(fadeAnim2, {
        toValue: 0.3,
        duration: 2000,
        useNativeDriver: true,
      })
    ]);

    // Movement - much faster and larger range
    const movementAnimation = Animated.sequence([
      Animated.timing(translateAnim, {
        toValue: 100,  // Increased from 60
        duration: 3000,  // Reduced from 6000
        useNativeDriver: true,
      }),
      Animated.timing(translateAnim, {
        toValue: 0,
        duration: 3000,
        useNativeDriver: true,
      })
    ]);

    // Rotation - faster
    const rotateAnimation = Animated.sequence([
      Animated.timing(rotateAnim, {
        toValue: 1,
        duration: 4000,  // Reduced from 8000
        useNativeDriver: true,
      }),
      Animated.timing(rotateAnim, {
        toValue: 0,
        duration: 4000,
        useNativeDriver: true,
      })
    ]);

    Animated.loop(breathingAnimation, { iterations: -1 }).start();
    Animated.loop(breathingAnimation2, { iterations: -1 }).start();
    Animated.loop(movementAnimation, { iterations: -1 }).start();
    Animated.loop(rotateAnimation, { iterations: -1 }).start();
  }, []);

  const rotate = rotateAnim.interpolate({
    inputRange: [0, 1],
    outputRange: ['0deg', '40deg']  // Increased rotation range from 30 to 40
  });

  return (
    <View style={styles.container}>
      {/* Base layer - large perspective grid */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim2,
            transform: [
              { perspective: 1000 },
              { rotateX: rotate },
              { translateX: Animated.multiply(translateAnim, -0.5) }
            ]
          }
        ]}
      >
        <Svg height="120%" width="120%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid3" 
              width="150" 
              height="150" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(15)"
            >
              <Line
                x1="0"
                y1="150"
                x2="150"
                y2="150"
                stroke="#F4E409"  // Changed to yellow
                strokeWidth="1"
              />
              <Line
                x1="150"
                y1="0"
                x2="150"
                y2="150"
                stroke="#F4E409"  // Changed to yellow
                strokeWidth="1"
              />
            </Pattern>
          </Defs>
          <Rect width="150%" height="150%" fill="url(#grid3)" x="-25%" y="-25%" />
        </Svg>
      </Animated.View>

      {/* Middle layer - connecting lines */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim,
            transform: [
              { perspective: 1000 },
              { rotateX: rotate },
              { translateX: translateAnim }
            ]
          }
        ]}
      >
        <Svg height="120%" width="120%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid" 
              width="60" 
              height="60" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(45)"
            >
              <Line
                x1="0"
                y1="60"
                x2="60"
                y2="60"
                stroke="#B8860B"  // Changed to darker yellow
                strokeWidth="0.5"
              />
              <Line
                x1="60"
                y1="0"
                x2="60"
                y2="60"
                stroke="#B8860B"  // Changed to darker yellow
                strokeWidth="0.5"
              />
              <Line
                x1="0"
                y1="0"
                x2="60"
                y2="60"
                stroke="#B8860B"  // Changed to darker yellow
                strokeWidth="0.3"
              />
            </Pattern>
          </Defs>
          <Rect width="140%" height="140%" fill="url(#grid)" x="-20%" y="-20%" />
        </Svg>
      </Animated.View>

      {/* Top layer - finest detail */}
      <Animated.View 
        style={[
          styles.overlay, 
          { 
            opacity: fadeAnim2,
            transform: [
              { perspective: 1000 },
              { rotateX: rotate },
              { translateX: Animated.multiply(translateAnim, -0.8) }
            ]
          }
        ]}
      >
        <Svg height="120%" width="120%" style={styles.grid}>
          <Defs>
            <Pattern 
              id="grid2" 
              width="30" 
              height="30" 
              patternUnits="userSpaceOnUse"
              patternTransform="rotate(-30)"
            >
              <Line
                x1="0"
                y1="30"
                x2="30"
                y2="30"
                stroke="#DAA520"  // Changed to golden yellow
                strokeWidth="0.3"
              />
              <Line
                x1="30"
                y1="0"
                x2="30"
                y2="30"
                stroke="#DAA520"  // Changed to golden yellow
                strokeWidth="0.3"
              />
              <Line
                x1="15"
                y1="0"
                x2="15"
                y2="30"
                stroke="#DAA520"  // Changed to golden yellow
                strokeWidth="0.2"
              />
              <Line
                x1="0"
                y1="15"
                x2="30"
                y2="15"
                stroke="#DAA520"  // Changed to golden yellow
                strokeWidth="0.2"
              />
            </Pattern>
          </Defs>
          <Rect width="140%" height="140%" fill="url(#grid2)" x="-20%" y="-20%" />
        </Svg>
      </Animated.View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    zIndex: -1,
    overflow: 'hidden',
  },
  overlay: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
  },
  grid: {
    position: 'absolute',
    top: 0,
    left: 0,
  },
});

export default GridBackground;
